const HomePage = () => {
  if (loading) {
    return <div>Loading...</div>;
  }

  if (!authenticated) {
    navigate('/login');
  }
  return (
    <div>
      <h1>Welcome to the Home Page!</h1>
      <p>This is the content for authenticated users.</p>
    </div>
  );
};

export default HomePage;
